def partition(arr, p, r):
    x = arr[r] # 4
    i = p - 1 # -1
    for j in range(p, r): # 4 1
        if arr[j] <= x:
            i = i + 1 # 1,
            tmp = arr[i] # 3,
            arr[i] = arr[j]
            arr[j] = tmp
    tmp = arr[i + 1]
    arr[i + 1] = arr[r]
    arr[r] = tmp
    return i + 1


def quickSort(arr, p, r):
    if p < r:
        q = partition(arr, p, r)
        quickSort(arr, p, q - 1)
        quickSort(arr, q + 1, r)

